import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const API_BASE_URL = process.env.REACT_APP_BACKEND_API_URL || 'http://localhost:5001/api';

const MindMapDashboard = () => {
  const [mindMaps, setMindMaps] = useState([]);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const session = JSON.parse(localStorage.getItem('mindmapSession'));
    if (!session || !session.token) {
      navigate('/');
      return;
    }
    fetch(`${API_BASE_URL}/mindmaps`, {
      headers: { 'Authorization': `Bearer ${session.token}` }
    })
      .then(res => res.json())
      .then(data => {
        setMindMaps(data);
        setLoading(false);
      })
      .catch(() => {
        setMessage('Failed to load mind maps.');
        setLoading(false);
      });
  }, [navigate]);

  const handleLoad = (id) => {
    navigate(`/mindmap/${id}`);
  };

  const handleNew = () => {
    navigate('/mindmap/new');
  };

  return (
    <div className="dashboard-container">
      <h2>Your Mind Maps</h2>
      <button onClick={handleNew}>+ New Mind Map</button>
      {loading ? (
        <p>Loading...</p>
      ) : mindMaps.length === 0 ? (
        <p>No mind maps found.</p>
      ) : (
        <ul>
          {mindMaps.map(map => (
            <li key={map._id}>
              <span>{map.title || 'Untitled'}</span>
              <button onClick={() => handleLoad(map._id)}>Open</button>
            </li>
          ))}
        </ul>
      )}
      {message && <div>{message}</div>}
    </div>
  );
};

export default MindMapDashboard;
